function listIndustries(data: Job[]): string[] {
    const industryNames = data.map((job) => job.industry);
    return Array.from(new Set(industryNames));
}

// console.log(listIndustries(testdata));
// console.log(listIndustries(greenjobs));

function groupBy(data: any[], key: string) {
  return data.reduce((result:any, currentValue:any) => {
    (result[currentValue[key]] = result[currentValue[key]] || []).push(currentValue);
    return result;
  }, {});
}

// console.log(groupBy(testdata, 'county'));
// console.log(groupBy(testdata, 'employerName'));

function mapGroupBy(data: Record<string, any[]>): Map<string, number> {
    return new Map(Object.keys(data).map(key => [key, data[key].length]));
}

function countyGreenJobs(data: Job[]) {
  return mapGroupBy(groupBy(data, 'county'));
}

// console.log(countyGreenJobs(testdata));
console.log(countyGreenJobs(greenjobs));

function jobsWithKeyword(data: Job[], keyword: string): string[] {
  const jobTitles: string[] = data.map((job) => job.jobTitle);
  const matchingTitles = jobTitles.filter((jobTitle) => jobTitle.includes(keyword));
  return Array.from(new Set(matchingTitles));
}

// console.log(jobsWithKeyword(greenjobs, "PV"));

function industryJobs(data: Job[]): { industry: string, jobs: number }[] {
    const byIndustry: Map<string, any[]> = groupBy(data, 'industry');
    
    return Object.entries(byIndustry).map(([key, value]) => ({
      industry: key,
      jobs: value.length
    }));
  }

// console.log(industryJobs(testdata));
// console.log(industryJobs(greenjobs));

function maxIndustryJobs(data: Job[]): {industry: string, jobs: number} {
  const jobsByIndustry = industryJobs(data);
  jobsByIndustry.sort((a, b) => b.jobs - a.jobs);
  return jobsByIndustry[0];
}

